import Card from "../../layout/card/Card";
import "./HomePage.scss";
import Search from "../../layout/search/Search";
import MobileNav from "./mobile-nav/MobileNav";
import About from "./about/About";
import Footer from "../../footer/Footer";
import Header from "../../header/Header";
import PopularRestaurant from "./PopularRestaurant";
import SignatureDish from "./SignatureDish";
import Icons from "./Icons";
import Chefs from "./Chefs";
import dummy from "../../DummyData";
import { Fragment } from "react";
import Slider from "react-slick";

const HomePage: React.FC = () => {
  const settings = {
    dots: true
  };
  return (
    <Fragment>
      <Header />
      <div className="card-bg">
        <Card>
          <p className="epicure-title">
            Epicure works with the top chef restaurants in Tel Aviv
          </p>
          <Search />
        </Card>
      </div>
      <MobileNav />
      <p>THE POPULAR RESTAURANTS IN EPICURE : </p>
      <div className="container">
      <Slider {...settings}>
        <PopularRestaurant populars={dummy} />
      </Slider>
      </div>
      <p>SIGNATURE DISH OF :</p>
      <div className="data-container">
        <SignatureDish signatures={dummy} />
      </div>
      <Icons />
      <p>CHEF OF THE WEEK :</p>
      <div>
        <Chefs chefs={dummy} />
      </div>
      <About />
      <Footer />
    </Fragment>
  );
};

export default HomePage;
